window.encodeImgURL20180615 = function (url) {
    url = url.replace(/&/g, '&amp;')
        .replace(/</g, '&lt;')
        .replace(/>/g, '&gt;')
        .replace(/\'/g, '&#39;')
        .replace(/\"/, '&quot;');

    url = encodeURI(url);
    if (url.indexOf('http://') !== 0) {
        return 'http://' + url;
    }
    return url;
}
